                                }), We = {
                                    'national-insurance-awareness-day': '<p>Insurance is an important tool to build financial security & protect your family\'s financial interests.  To ensure that every person has access to essential life, health, and property insurance, and every business can find suitable insurance options, IRDAI has set a goal of achieving \'Insurance for all\' by 2047.<br><br>\n  HDFC Life in partnership with ET Now launched a special campaign called Life Sessions, aimed at highlighting the importance of life insurance. Life insurance has a crucial role to play for individuals across all stages & phases of life. Not only does it help secure the future & happiness of one\u2019s family but can also create a secondary source of income, if planned wisely.<br><br>\n  Despite the many benefits the penetration for life insurance in India is projected to be at approximately 3% in 2023-24, as per a Swiss Re Institute report. This is majorly driven by the myths, misconceptions & lack of awareness that surrounds life insurance <br><br>And thus, as we celebrate Insurance Awareness Day on 28th June, HDFC Life is back with another initiative \u2018Bridge The Gap to secure future\u2019<br><br>It is under this initiative that we built Life Sessions, which brings together financial experts who help Indians across generations & stages of life to understand and pick Life Insurance for themselves and their loved ones.<br><br>The sessions are hosted by Kavita Thapliyal, a personal finance expert, who is known & celebrated for her knowledge and hold on the finance industry & for empowering people attain financial freedom.</p>',
                                    'indian-super-women': '<p>On the occasion of International Women\'s Day 2023, Times Now dedicates a special series titled \'Indian Superwomen: The Path To Glory\' to India\'s daughters, who have made the country proud at several sporting events. This initiative is supported by Morpheus Dare To Dream Music Cards.<br></br>As part of this initiative, Times Now spoke with ten women athletes, whose \u2018Dare To Dream\u2019 spirit have made the country proud on many occasions. These Indian Superwomen have not only won laurels for the country, but have also brought a change in the society.<br></br>From Bhavina Patel, who was diagnosed with polio at the age of one after which her life hit a roadblock to Deepika Kumari, who did not have access to proper washrooms while training in a remote village, the \'Indian Superwoman: The Path To Glory\' series covers the incredible journeys of these female athletes, who were determined to carve an identity of their own.<br></br>These superwomen have \u2018Dared To Dream\u2019 big and through hard work, determination and support of their families, have fulfilled their dreams as well.</p>'
